import React from "react";

function About() {
    return(
        <div>

                <p>Hey! People also call me Grace!</p>
                <p>Currently I am working as a designer in NYC.</p>                         
                <p>I graduated from Pratt Institute last year October with a MFA in Communication Design.</p>              
                <p>Now I'm doing a full stack web development Boot Camp immersively online.</p>   


        </div>
    );
}
export default About;
